import { Card } from "react-bootstrap";
import image1 from "../../images/img1.jpg";

function TopCard() {
  return (
    <div className="top">
      <Card>
        <Card.Img variant="top" src={image1} alt="top pic" />
      </Card>
    </div>
  );
}

export default TopCard;
